import React from 'react';
import Grid  from '@material-ui/core/Grid';
import instagram_img from '../../images/9364675fb26a.svg';

const login = () => {
  return (
    <div>
      <Grid item xs={3}>
        Hello
      </Grid>
      <Grid item xs={6}>
        <div>
            <div>
                <img src={instagram_img} width="450"/>
            </div>
        </div>
      </Grid>
      <Grid item xs={3}>
        Simplelearn
      </Grid>
    </div>
  )
}

export default login;
